import React from "react";
import { Helmet } from "react-helmet";
import ListItem from "../Components/ListItem";

import gfg from "../Assets/gfg.png";
import cm from "../Assets/cm.jpg"
import gssoc from "../Assets/gssoc.png"

function Experience() {
  return (
    <>
      <Helmet>
        <title>Experience | Tarun Singh</title>
      </Helmet>
      <div className="bg-white dark:bg-black h-screen">
        <div className="flex items-center justify-center">
          <h1 data-aos="fade-in" className="text-5xl font-bold text-blue">
          Experience
          </h1>
        </div>
        <section className="bg-gray-100 mt-10 p-4 container mx-auto">
            <ListItem logo={cm} title="Technical Content Writer" company="Coding Minutes" date="Sep 2022 - Present" description="" location="Remote" />
            <ListItem logo={gssoc} title="Mentor" company="Girlscript Summer of Code" date="Sep 2020 - Present" description="Mentored students in Girlscript Summer of Code for Open Source project for
Social Good.
• Reviewed various codes and GitHub repo’s of participants related to HTML/CSS,
Bootstrap, and React etc." location="Remote" />
            <ListItem logo={gfg} title="Technical Content Writer" company="GeeksforGeeks" date="Oct 2020 - Aug 2021" description="" location="Remote" />
        </section>
      </div>
    </>
  );
}

export default Experience;
